import * as React from 'react';
import { View, Text, TouchableOpacity, StyleSheet } from "react-native";
import { Header, Icon } from "@rneui/base"; // Importe o Header do React Native Elements
import { SafeAreaProvider } from "react-native-safe-area-context";
import FontAwesomeIcon from 'react-native-vector-icons/FontAwesome';

export default function ListaTell({ navigation }) {
  return (
    <SafeAreaProvider>
      <Header
        backgroundImageStyle={{}}
        barStyle="default"
        centerComponent={{
          text: "MY TITLE",
          style: { color: "#fff" }
        }}
        centerContainerStyle={{}}
        containerStyle={{ width: 350 }}
        leftContainerStyle={{}}
        linearGradientProps={{}}
        placement="center"
        rightComponent={{
          icon: "add",
          color: "#fff",
          onPress: () => navigation.navigate("NovoContato") // Adicione a navegação aqui
        }}
        rightContainerStyle={{}}
        statusBarProps={{}}
      />

      <View style={styles.content}>
        <Text>Bem-vindo ao sistema</Text>
      </View>
    </SafeAreaProvider>
  );
}

const styles = StyleSheet.create({
  content: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  header: {
    height: 50,
    backgroundColor: "#1670f7",
    borderBottomColor: "#000000",
    flexDirection: 'row',
    alignItems: "center",
    justifyContent: "space-around",
  },
  title: {
    fontSize: 20,
    fontWeight: "bold",
    color: "#ffff",
  },
});
